  \"2015-01-22T15:57:58.093252\",\n\t\"name\": \"qualified-census-tracts\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Qualified Census Tract (QCT) is any census
  tract (or equivalent geographic area defined by the Census Bureau) in which at least
  50% of households have an income less than 60% of the Area Median Gross Income (AMGI).
  HUD has defined 60% of AMGI as 120% of HUD's Very Low Income Limits (VLILs), which
  are based on 50% of area median family income, adjusted for high cost and low income
  areas.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
